import { ItemList } from "./ItemList";
import {Macetas} from "./Item";
import React from "react";

export const ItemListMacetas = () => {



  return (

    Macetas.map(producto => {

      return (

          <div className=" cardPadre">
            <ItemList
              productoProp={producto}

            />
          </div>



      )
    })



  )



};
